let state = {
   profilePage: {
      postsData: [
         { id: 1, message: "Hello, whats up?", likes: 20 },
         { id: 2, message: "It's my birthday today", likes: 30 },
       ],
   },
   messagesPage: {
      dialogsData: [
         { id: 1, name: "Asik" },
         { id: 2, name: "Beka" },
         { id: 3, name: "Azik" },
         { id: 4, name: "Baur" },
       ],
       messagesData: [
         { id: 1, message: "Hello" },
         { id: 2, message: "Hi" },
         { id: 3, message: "Fuck you" },
         { id: 4, message: "Bitch" },
       ],
   }


};

export default state
